import Search from "../img/loupe.png";
import Logout from "../img/Logout.png";
import Logo from "../img/ToraLogo.png";
import styled from "styled-components";
import Buttons from "../buttons";

const ImgContainer = styled.div`
  display: flex;
  justify-content: space-around;
  width: 100%;
`;

const Img = styled.img`
  width: 30px;
  display: flex;
  justify-content: space-between;
  cursor: pointer;
  opacity: 0.7;
  &:hover {
    opacity: 1;
  }
  &:active {
    opacity: 0.5;
  }
`;

const ImgLogo = styled.img`
  width: 30px;
  display: flex;
  justify-content: space-between;
  cursor: pointer;
  margin-left: 30px;
  opacity: 0.7;
  &:hover {
    opacity: 1;
  }
  &:active {
    opacity: 0.5;
  }
`;

const Icons = () => {
  return (
    <>
      <ImgContainer>
        <ImgLogo src={Logo} alt="Logomarca da empresa" />
        <div>
        <Buttons />
        <Img src={Search} alt="Lupa de pesquisa" />
        <Img src={Logout} alt="Ícone de Logout" />
        </div>
      </ImgContainer>
    </>
  );
};
export default Icons;
